The equals operator (==) tests two expressions for equality and returns a bool. fn main() { print(1 == 1); // true print(1 == 2); // false
} Equality is a tricky thing. There is reference equality, and value equality. I've taken the perspective that if you can point to two different things, even if they are identical, they are still two different things. This is reference equality. Equality is transitive. There is exactly one unique representation of 1 in the language, and in the CPU. That is why the following works. fn main() { let a = 1; let b = 1; print(a == b); // true
} struct Foo {}
struct Bar { bar: int } fn main() { let a = Foo {}; let b = Foo {}; let e = b; print(e == b); // false let c = 1; let d = c; print(a == b); // false print(c == d); // true? false? let f = Bar { bar: 1 }; let g = Bar { bar: 1 }; let h = f; print(h == f); // true print(f == g); // true? false? f.bar = 2; print(f == g); // true? false? print(h == f); // true? false?
} That said, it's a matter of perspective. ChaCha knows about references, but dwarf does not.

